import { React, useState } from 'react';
import { MapContainer, TileLayer, Marker, Popup } from 'react-leaflet'




const Location = (props) => {

    const [center, setCenter] = useState({ lat: 48.862725, lng: 2.287592 })

    const containerMapStyle = {
        height: '500px',
        width: '64%'
    }


    return (
        <MapContainer
            center={center}
            zoom={9}
            style={containerMapStyle}
        >
            <TileLayer
                url='https://api.maptiler.com/maps/basic/?key=WzbI7kOa26WXiwQXx4jQ#15.0/36.77020/10.19923'
                attribution='<a href="https://www.maptiler.com/copyright/" target="_blank">&copy; MapTiler</a> <a href="https://www.openstreetmap.org/copyright" target="_blank">&copy; OpenStreetMap contributors</a>'
            />
            {/* <iframe width="500" height="300" src="https://api.maptiler.com/maps/basic/?key=WzbI7kOa26WXiwQXx4jQ#15.0/36.77020/10.19923"></iframe> */}

        </MapContainer>
    )

}

export default Location


